import React from 'react';
import imgProfile from '../../../assets/defaultImg/default.jpg'
function Profile(props) {
    return (
      <div className='profile'>
        <img className='profile_' src={imgProfile} alt='profile'></img>
      </div>
    )
}

export default Profile;
